#! /bin/bash

#
# Some 64-bit Linux systems cannot run 32-bit binaries without the addition of the ia32-libs
# package. This script knows of all of the 64-bit Linux distributions we've encountered which
# require this library. It checks those systems to see if the package is required to be able
# to run the binary installer embedded into this script. If so, it attempts to load the ia32-libs
# package.
#
# Next, this script extracts the binary installer and runs it. If you encounter a 64-bit system
# where the intaller does not work, please let us know. You might see if there is a 32-bit
# library package other than ia32-libs required to run the binary installer. Hand installing
# that package may allow the binary installer to run.
#
# Note: This script requires perl to extract the base_64 embedded binary installer. If your
# system does not have perl, then the script portion of this installer will fail.
#

# Run with a restricted path...
export PATH=/bin:/usr/bin:/sbin:/usr/sbin:/etc
Pid="$$"
TMPDIR=
Cleanup=true
X86=i686

# Error Return values (from VarAgentUtil.h in the Windows agent)
K_OK=0
K_FILE_NOT_FOUND=-4
K_INV_PARAM=-9
K_SERVICE_NOT_FOUND=-20
K_INSTALLER_EXTRACTION_FAILED=-51
K_INSTALLER_FAILED_TO_LOAD_32BIT_PACKAGES_STR=-53
K_UNKNOWN_ERROR=-54
K_PKG_INSTALL_FAILURE=-55
OS=Unknown
OSVersion=Unknown
Machine=$(uname -m)

declare -a Args=("$@")
Silent=false
Verbose=
OSOnly=
if [ -r "/tmp/kcsMask" ]
then
    kcsMask="$(cat /tmp/kcsMask)"
    if [ "$kcsMask" != "31" -a "$kcsMask" != "0x1f" ]
    then
        Debug=true
    fi
fi

for arg in "${Args[@]}"
do
    case "$arg" in
    -x)         set -x ;;
    -s|/s)      Silent=true ;;
    -V)         Verbose=-s ;;
    -D)         Debug=true ;;
    -X)         Cleanup= Debug=true ;;
    -P)         Pid="TESTKCS" Debug=true Verbose=-s ;;
    --tmpdir=*) TMPDIR=${arg#--tmpdir=} ;;
    --version)  Version=true ;;
    --os)       OSOnly=true ;;
    esac
done

syslog() {
    [ "$Debug" == "true" ] && logger -t "[KcsSetup.sh][$Pid]" -p "user.debug" $Verbose "$1"
}

varLogCreate() {
    local date=$(date +'%Y/%m/%d %H:%M:%S')
    (echo "Start time: $date" > "$KAGENT_INSTALL_LOG") 2> /dev/null
    syslog "Start time: $date"
}

varLogWrite() {
    local mtype="$1"
    local prefix
    local debug=""
    local out=
    local saveVerbose=$Verbose

    if [ "$Silent" == "false" -a \( "$mtype" == "F" -o "$mtype" == "W" \) ]
    then
        out=true
        Verbose=
    fi

    case "$mtype" in
    I)    prefix="Informational:" ;;
    F)    prefix="Fatal:" ;;
    W)    prefix="Warning:" ;;
    D)    prefix="Debug:        "; debug=true ;;
    esac

    shift       # skip the mtype parameter
    while [ -n "$1" ]
    do
        (printf "%-16s%s\n" "$prefix" "$1" >> "$KAGENT_INSTALL_LOG") 2> /dev/null
        [ -n "$out" ] && printf "%-15s %s\n" "$prefix" "$1"
        syslog "$prefix $1"
        shift
        prefix=""
    done
    Verbose=$saveVerbose
}

getInstallerDir() {
    local dir=$(dirname ${BASH_SOURCE[0]})

    (cd "$dir"; /bin/pwd)
}
KCS_DIRNAME=$(getInstallerDir)

varLogCreate

getMountPoint() {
    local cur="/"
    local dir=$1

    (mount; echo EOF) | \
    while read topoint on mountpoint tlabel type options extra
    do
        if [ "$topoint" == "EOF" ]
        then
            echo "$cur"
            return
        fi
        if [ "$dir" == "$mountpoint" ]
        then
            echo "$dir"
            return
        elif [ "$mountpoint" != "/" ]
        then
            pref="${dir#$mountpoint}"
            if [ "$pref" != "$dir" ]
            then
                if [ ${#pref} > ${#cur} ]
                then
                    cur=$mountpoint
                fi
            fi
        fi
    done
}

getMountOptions() {
    local mpoint="$1"

    mount | \
    while read topoint on mountpoint tlabel type options extra
    do
        if [ "$mpoint" == "$mountpoint" ]
        then
            echo "$options"
            return
        fi
    done
}

# This installer will not work if /tmp is installed with the noexec flag. Validate that the temp
# directory is valid and executable. If not, suggest a solution and exit.
checkTempDir() {
    local tmpdir=$(cd "$1" && /bin/pwd)

    if [ ! -d "$tmpdir" ]
    then
        varLogWrite D "checkTempDir failed for \"$tmpdir\" becase the file exists and is not a directory."
        echo bad
    fi

    # Now verify we're not using a noexec filesystem for TMPDIR
    local mountpoint=$(getMountPoint "$tmpdir")
    local mountopts=$(getMountOptions "$mountpoint")

    if echo "$mountopts" | grep -w -q noexec
    then
        varLogWrite D "checkTempDir failed for \"$tmpdir\" becase the directory is mounted noexec."
        echo bad
    fi
    echo OK
}

setValidTmpdir() {
    for t in $1 /tmp /var/tmp /usr/tmp
    do
        if [ "$(checkTempDir $t)" == "OK" ]
        then
            echo "$t"
            return
        fi
    done
}

TMPDIR=$(setValidTmpdir $TMPDIR)
if [ -z "$TMPDIR" ]
then
    varLogWrite F "Installation of the Agent failed because no temp directory can be found which allows execution."
    varLogWrite F "Consider using the \"--tmpdir=<dir>\" option (run \"KcsSetup.sh --help\" for option details)."
    exit $K_INV_PARAM
else
    varLogWrite "D" "Using \"$TMPDIR\" for storage of temporary files."
fi

KCS_SETUP_ENCODED=$TMPDIR/KcsSetup$Pid.base64
KCS_BASENAME=$(basename $0)
KCS_SETUP=$TMPDIR/$KCS_BASENAME$Pid
KAGENT_INSTALL_LOG="/tmp/KASetup_$Pid.log"
KCS_VERSION_FILE="$TMPDIR/KASetup_$Pid.version"
PKG_ERROR_LOG="$TMPDIR/KASetup_Pkg_Errors_$Pid.log"

trap 'cleanup' EXIT

cleanup() {
    local rc=$?

    trap '' EXIT

    [ "$Cleanup" == "true" ] && rm -f "$KCS_SETUP_ENCODED" "$KCS_SETUP" "$KCS_VERSION_FILE" "$PKG_ERROR_LOG"
    [ -n "$Version" ] && rm -f "$KAGENT_INSTALL_LOG"

    # Always remove a zero length file (only applies when not cleaning up)
    [ -f "$PKG_ERROR_LOG" -a \! -s "$PKG_ERROR_LOG" ] && rm -f $PKG_ERROR_LOG

    exit $rc
}

# Find the path of the installer. This will be used to extract the embedded
# binary installer.
getInstallerPath() {
    local p="${BASH_SOURCE[0]}"

    if [ "${p:0:1}" == "/" ]
    then
        echo "$p"
    else
        (command cd $(dirname "$PWD/$p"); echo "$PWD/$(basename $p)")
    fi
}

getOSInfo() {
    local osver=

    foo='Starting getOSInfo'
    if [ -r /etc/mageia-release ]
    then
        OS=Mageia
        OSVersion=Mageia$(awk '{print $1$3}' /etc/mageia-release)
    elif [ -r /etc/redhat-release ]
    then
        osver=$(cat /etc/redhat-release)
        case "${osver/ */}" in
        Red)        OS=RedHat ;;
        CentOS)     OS=CentOS ;;
        ClearOS)    OS=ClearOS ;;
        Fedora)     OS=Fedora ;;
        Scientific) OS=Scientific ;;
        Oracle)     OS=OES ;;
        default)    OS=RedHat ;;
        esac

        if [ "$OS" == "Fedora" ]
        then
            tmp1=${osver#Fedora release }
            OSVersion=$OS${tmp1%% *}
        else
            if grep -q 'release 8' /etc/redhat-release
            then
                OSVersion=${OS}8
            elif grep -q 'release 7' /etc/redhat-release
            then
                OSVersion=${OS}7
            elif grep -q 'release 6' /etc/redhat-release
            then
                OSVersion=${OS}6
            elif grep -q 'release 5' /etc/redhat-release
            then
                OSVersion=${OS}5
            elif grep -q 'release 4' /etc/redhat-release
            then
                OSVersion=${OS}4
            #else
                # Leave it as is...
            fi
        fi
    elif [ -r /etc/debian_version ]
    then
        if [ -r /etc/lsb-release ] && grep -q 'DISTRIB_ID=' /etc/lsb-release
        then
            OS=$(awk -F= '/DISTRIB_ID=/{print $2}' /etc/lsb-release)
            if [ "$OS" == "LinuxMint" ]
            then
                OSVersion=$OS$(awk -F= '/DISTRIB_RELEASE=/{print $2}' /etc/lsb-release)
            else
                OSVersion=$OS$(awk -F= '/DISTRIB_RELEASE=/{print $2}' /etc/lsb-release | tr -d ' .')
            fi
        elif [ -r /etc/os-release ]
        then
            OS=Debian
            OSVersion="Debian$(tr -d ' .' < /etc/debian_version)"
        else
            OS=Debian
            OSVersion="Debian$(tr -d ' .' < /etc/debian_version)"
        fi
    elif [ -r /etc/SuSE-release ]
    then
        vtmp=$(grep -i '^VERSION' /etc/SuSE-brand | awk '{print $3}' | awk -F "\\." '{print $1}')
        osver=$(head -n 1 /etc/SuSE-brand)
        case "$osver" in
        openSUSE*)      OS=openSUSE
                        OSVersion=openSUSE${vtmp%%.*}
                        ;;
        SUSE*)          if [ "${OSVersion#SUSE Linux Enterprise Server}" != "$OSVersion" ]
                        then
                            OS=SLES
                            OSVersion=SLES${vtmp%%.*}
                        elif [ "${OSVersion#SUSE Linux Enterprise Desktop}" != "$OSVersion" ]
                        then
                            OS=SLED
                            OSVersion=SLED${vtmp%%.*}
                        else
                            OS=SLE
                            OSVersion=SLE${vtmp%%.*}
                        fi
                        ;;
        esac
    fi
    foo='Done with getOSInfo'
}

runLddCmd() {
    local cmd="$1"

    foo='Starting runLddCmd'
    varLogWrite "D" "Running \"ldd $cmd\"."
    ldd "$cmd" | \
    while read line
    do
        echo "line: [$line]"
        if [ "$line" == "not a dynamic executable" ]
        then
            varLogWrite "F" "Installation of the Agent failed because we could not run the embedded binary installer."
            if [ "$Machine" == "x86_64" -o "$Machine" == "ia64" ]
            then
                varLogWrite "" "The binary is not recognized as a dynamic executable. This probably means the system is"
                varLogWrite "" "missing the 32-bit dynamic loader (/lib/ld-linux.so.2)."
            fi
            break
        fi
    done
    foo='Done with runLddCmd'
}

attemptLibraryFixup() {

    foo='Starting attemptLibraryFixup'
    installStandardLibraries
    if ! $KCS_SETUP --version > $KCS_VERSION_FILE 2>&1
    then
        runLddCmd "$KCS_SETUP"
        exit $K_UNKNOWN_ERROR
    fi
    foo='Done with attemptLibraryFixup'
}

installStandardLibraries() {
    local Apt_Get=$(type -p apt-get)
    local Dpkg=$(type -p dpkg)
    local Yum=$(type -p yum)
    local Zypper=$(type -p zypper)
    local libs=
    local eol=

    foo='Starting installStandardLibraries'

    if [ "$Machine" == "x86_64" -o "$Machine" == "ia64" ]
    then
        # Doing 64-bit install
        if [ \( -f /etc/lsb-release -o -f /etc/debian_version \) -a -n "$Apt_Get" -a -n "$Dpkg" ]
        then
            # Note: For systems with dpkg >= 1.16.2 (Debian 7.0, Mint 14, and Ubuntu 13.04) installed, you must do add
            # the i386 architecture. They have a different multiarch model.
            #    # dpkg --add-architecture i386
            #    # apt-get update
            #    # apt-get install libc6:i386 libstdc++6:i386 libglib2.0-0:i386

            local   version=$(LC_ALL=C $Dpkg --version | head -1 | awk '{print $7}')

            if [ -n "$version" ]
            then
                major=${version%%.*}
                tmp1=${version#*.}
                minor=${tmp1%%.*}
                tmp2=${tmp1#*.}
                dot=${tmp2%%.*}

                if (( $major > 1 || ($major == 1 && $minor > 16) || ($major == 1 && $minor == 16 && $dot >= 2)))
                then
                    varLogWrite "D" "Adding i386 architecture to dpkg and updating cache (this may take a while)."
                    $Dpkg --add-architecture i386
                    $Apt_Get update 2>&1 > /dev/null
                fi
            fi

            case "$OSVersion" in
            Ubuntu[789]*)       eol=true ;;
            Ubuntu1[01]*)       libs="libc6-i386        ia32-libs" ;;
            Ubuntu1[468]*|LinuxMint1[34567]*)
                                libs="libc6:i386" ;;
            Ubuntu2[012]*)
                                libs="libc6:i386" ;;
            Debian[45]*)        eol=true ;;
            Debian6*)           libs="libc6-i386        ia32-libs-gtk" ;;
            Debian7*)           libs="libc6-i386" ;;
            Debian8*)           libs="libc6-i386" ;;
            esac

            if [ -n "$libs" ]
            then
                if ! $Apt_Get -y install $libs > /dev/null 2> $PKG_ERROR_LOG
                then
                    varLogWrite "F" "This installation failed because we could not install packages required to run the binary"
                    varLogWrite ""  "part of the installer. We cannot complete the install without loading 32-bit library"
                    varLogWrite ""  "packages so we are aborting."
                    exit $K_PKG_INSTALL_FAILURE
                fi
            elif [ -n "$eol" ]
            then
                varLogWrite "F" "This Linux release ($OSVersion) has been EOL'ed and we cannot install packages on an EOL'ed system."
                varLogWrite "F"  "We cannot complete the install without loading 32-bit library packages so we are aborting."
                exit $K_PKG_INSTALL_FAILURE
            else
                varLogWrite "F" "Could not match $OSVersion to a supported OS. The Agent (and this installer) require the following"
                varLogWrite "F"  "32-bit libraries: libc.so to run on this release."
                exit $K_PKG_INSTALL_FAILURE
            fi
        elif [ -f /etc/SuSE-brand -a -n "$Zypper" ]
        then
            # OpenSUSE changed a required library (libstdc++) in a dot release for each of the 1st 3 12.x releases.
            #case "$OSVersion" in
            #openSUSE11*)        eol=true ;;
            #openSUSE12*)        libs="glibc-32bit" ;;
            #openSUSE13*)        libs="glibc-32bit" ;;
            #esac
            libs="glibc-32bit" 

            if [ -n "$libs" ]
            then
                if ! $Zypper install -y $libs > /dev/null 2> $PKG_ERROR_LOG
                then
                    varLogWrite "F" "This installation failed because we could not install packages required to run the binary"
                    varLogWrite ""  "part of the installer. We cannot complete the install without loading 32-bit library"
                    varLogWrite ""  "packages so we are aborting."
                    exit $K_PKG_INSTALL_FAILURE
                fi
                ldconfig
            elif [ -n "$eol" ]
            then
                varLogWrite "F" "This Linux release ($OSVersion) has been EOL'ed and we cannot install packages on an EOL'ed system."
                varLogWrite "F"  "We cannot complete the install without loading 32-bit library packages so we are aborting."
                exit $K_PKG_INSTALL_FAILURE
            else
                varLogWrite "F" "Could not match $OSVersion to a supported OS. The Agent (and this installer) require the following"
                varLogWrite "F"  "32-bit libraries: libc.so to run on this release."
                exit $K_PKG_INSTALL_FAILURE
            fi
        elif [ \( -f /etc/redhat-release -o -f /etc/fedora-release \) -a -n "$Yum" ] && yumCheck "$Yum"
        then
            case "$OSVersion" in
            Fedora1[123456]*)   eol=true ;;
            Fedora1[789]*)      libs="glibc.i686" ;;
            Fedora2[01234]*)    libs="glibc.i686" ;;
            RedHat5|CentOS5|OES5)
                                libs="none" ;;
            RedHat[678]*|CentOS[678]*|ClearOS[678]*|Scientific[687]*|OES[678]*)
                                libs="glibc.i686" ;;
            esac

            if [ -n "$libs" ]
            then
                if [ $libs != "none" ]; then
                    $($Yum -y install $libs > /dev/null 2> $PKG_ERROR_LOG)
                    if [ -s "$PKG_ERROR_LOG" ]                  # If the error file has a non-zeor size...
                    then
                        if grep -q "Couldn't resolve host" "$PKG_ERROR_LOG" ||
                                grep -q "Cannot find a valid baseurl for repo:" "$PKG_ERROR_LOG"
                        then
                            # CentOS 6 Minimal installs with eth0 unconfigured. This should catch that case.
                            varLogWrite "F" "Could not contact a yum host. Is the network configured and running?"
                        elif grep -q 'Protected multilib versions' "$PKG_ERROR_LOG"
                        then
                            # If the x86_64 version of a required library is older than the one in the i686 version in
                            # the repository, then we'll get the "Protected multilib version" mismatch error.
                            varLogWrite "F" "Version mismatch in required libraries. Run \"yum update\" before installing."
                        else
                            varLogWrite "F" "Error installing required packages with yum."
                        fi
                        exit $K_PKG_INSTALL_FAILURE
                    fi
                fi
            elif [ -n "$eol" ]
            then
                varLogWrite "F" "This Linux release ($OSVersion) has been EOL'ed and we cannot install packages on an EOL'ed system."
                varLogWrite "F"  "We cannot complete the install without loading 32-bit library packages so we are aborting."
                exit $K_PKG_INSTALL_FAILURE
            else
                varLogWrite "F" "Could not match $OSVersion to a supported OS. The Agent (and this installer) require the following"
                varLogWrite "F"  "32-bit libraries: libc.so to run on this release."
                exit $K_PKG_INSTALL_FAILURE
            fi
        else
            varLogWrite "D" "No package installations for $OS (64-bit)."
        fi
    else
        # Doing 32-bit install
        if [ \( -f /etc/lsb-release -o -f /etc/debian_version \) -a -n "$Apt_Get" ]
        then
            # This Linux system is Ubuntu or Debian (or possibly derived from one of those)
            $Apt_Get -y install libc6 2>&1 > /dev/null
        elif [ -f /etc/SuSE-release -a -n "$Zypper" ]
        then
            $Zypper install -y glibc-32bit
            ldconfig
        elif [ \( -f /etc/redhat-release -o -f /etc/fedora-release \) -a -n "$Yum" ] && yumCheck "$Yum"
        then
            $($Yum -y install glibc > /dev/null 2> $PKG_ERROR_LOG)
            if [ -s "$PKG_ERROR_LOG" ]
            then
                if grep -q "Couldn't resolve host" "$PKG_ERROR_LOG" ||
                   grep -q "Cannot find a valid baseurl for repo:" "$PKG_ERROR_LOG"
                then
                    # CentOS 6 Minimal installs with eth0 unconfigured. This should catch that case.
                    varLogWrite "F" "Could not contact a yum host. Is the network configured and running?"
                elif grep -q 'Protected multilib versions' "$PKG_ERROR_LOG"
                then
                    # If the x86_64 version of a required library is older than the one in the i686 version in
                    # the repository, then we'll get the "Protected multilib version" mismatch error.
                    varLogWrite "F" "Version mismatch in required libraries. Run \"yum update\" before installing."
                else
                    varLogWrite "F" "Error installing required packages with yum."
                fi
                exit $K_PKG_INSTALL_FAILURE
            fi
        else
            varLogWrite "D" "No package installations for $OS (32-bit)."
        fi
    fi
    foo='Done with installStandardLibraries'
}

yumCheck() {
    local yum="$1"

    foo='Starting yumCheck'
    if [ -n "$yum" ]
    then
        ($yum list updates > $PKG_ERROR_LOG 2>&1) &
        pid=$!
        sleep 5
        kill $pid > /dev/null 2>&1                          # The process may already have terminated
        if [ -r "$PKG_ERROR_LOG" ]
        then
            if grep -q "Another app is currently holding the yum lock" "$PKG_ERROR_LOG"
            then
                local pkgtmp=$(grep "The other application is" "$PKG_ERROR_LOG" | head -1)
                local pkg=${pkgtmp#  The other application is: }

                varLogWrite "F" "Installation of the Agent failed because we could not acquire the yum lock."
                if [ -n "pkg" ]
                then
                    varLogWrite "" "The lock is help by: \"$pkg\"."
                fi
                if [ -r /var/run/yum.pid ]
                then
                    varLogWrite "" "The PID of the process holding the lock is: \"$(cat /var/run/yum.pid)\"."
                fi

                exit $K_PKG_INSTALL_FAILURE
            elif grep -q "Error: Package: " "$PKG_ERROR_LOG" && grep -q "Available: " "$PKG_ERROR_LOG"
            then
                # Note: This appears to be an issue of RH 5 pkgs on an RH 6 system (or CentOS or ...). Its not clear that this message displays
                # for "yum list updates". If so, then the problem will still hang the installer...
                varLogWrite "F" "Installation of the Agent failed because the \"yum\" package tool is looping."
                exit $K_PKG_INSTALL_FAILURE
            elif grep -q "database disk image is malformed" "$PKG_ERROR_LOG"
            then
                varLogWrite "F" "Installation of the Agent failed because the rpm database is malformed." \
                                "Consider running \"rpm --rebuilddb\"."
                exit $K_PKG_INSTALL_FAILURE
            elif grep -q "This system is not registered to Red Hat Subscription Management" "$PKG_ERROR_LOG"
            then
                varLogWrite "F" "Installation of the Agent failed because this system is not " \
                                "registered to Red Hat Subscription Management."
                exit $K_PKG_INSTALL_FAILURE
            elif grep -q "Could not retrieve mirrorlist" "$PKG_ERROR_LOG"
            then
                varLogWrite "F" "Installation of the Agent failed because we could not retrieve the mirrorlist. " \
                                "Is this sytem's network connected?"
                exit $K_PKG_INSTALL_FAILURE
            elif grep -q "Couldn't resolve host" $PKG_ERROR_LOG || 
                 grep -q "Cannot find a valid baseurl for repo:" "$PKG_ERROR_LOG"
            then
                # CentOS 6 Minimal installs with eth0 unconfigured. This should catch that case.
                varLogWrite "F" "Could not contact a yum host. Is the network configured and running?"
                exit $K_PKG_INSTALL_FAILURE
            elif grep -q 'Protected multilib versions' "$PKG_ERROR_LOG"
            then
                # If the x86_64 version of a required library is older than the one in the i686 version in
                # the repository, then we'll get the "Protected multilib version" mismatch error.
                varLogWrite "F" "Version mismatch in required libraries. Run \"yum update\" before installing."
                exit $K_PKG_INSTALL_FAILURE

            #elif [64-bit libs are older than 32-bit libs] *** Hmm, this wouldb't be seen here!
            fi
        fi
    fi
    foo='Done with yumCheck'
    return 0
}

# Set OS ans OSVersion. Then post a message to the log file
getOSInfo
varLogWrite "I" "Installing Agent on $OS ($OSVersion)."
if [ -n "$OSOnly" ]
then
    printf "%-15s %s\n" "$(hostname):" "$OSVersion"
    exit 0
fi

case "$OSVersion" in
    Fedora*|RedHat*|CentOS*|Scientific*|ClearOS*)
        Yum=$(type -p yum)
        if [ -n "$Yum" ] && yumCheck "$Yum"
        then
            if [ -z "$(type -p perl)" ]
            then
                varLogWrite "D" "Installing perl."
                $Yum install -y perl 2>&1 > /dev/null
            fi
            if $Yum list available perl-Sys-Syslog > /dev/null 2>&1
            then
                $Yum install -y perl-Sys-Syslog > /dev/null 2>&1
            fi
        fi
        ;;

    Debian7*)                                               # A Miniman Debian doesn't come with the MIME module installed
        varLogWrite "D" "Installing the libmime perl package."
        apt-get install -y libmime-base64-urlsafe-perl 2>&1 > /dev/null
        ;;
esac

# Several installation files get appended to KcsSetup.sh. The "ThisFile" variable is instrumental in extracting them.
ThisFile=$(getInstallerPath)
if [ -z "$ThisFile" -o ! -r "$ThisFile" ]
then
    varLogWrite "F" "Installation of the Agent failed because the path of KcsSetup.sh could not be determined."
    exit $K_FILE_NOT_FOUND
fi

if [ -n "$KCS_BASENAME" -a -n "$KCS_DIRNAME" ]
then
    varLogWrite "I" "$KCS_BASENAME launched from: $KCS_DIRNAME."
fi

varLogWrite "D" "Using TMPDIR set to \"$TMPDIR\"."

Tail=$(type -p tail)
if [ -z "$Tail" ]
then
    varLogWrite "F" "Installation of the Agent failed because of missing dependencies (\"/usr/bin/tail\")."
    exit $K_FILE_NOT_FOUND
fi
Head=$(type -p head)
if [ -z "$Tail" ]
then
    varLogWrite "F" "Installation of the Agent failed because of missing dependencies (\"/usr/bin/head\")."
    exit $K_FILE_NOT_FOUND
fi

KArgs=$(tail -n 5 $ThisFile | head -n 1)
if [ -z "$KArgs" ]
then
    varLogWrite "F" "Cannot extract installation options from KcsSetup.sh."
    exit $K_INSTALLLER_EXTRACTION_FAILED
else
    set $KArgs
    for arg
    do
        if [ "${arg:0:2}" == "/a" ]
        then
            agentGuid="${arg:3}"
        fi
        if [ "$arg" == "-s" -o "$arg" == "/s" ]
        then
            Silent=true
        fi
    done
fi

# Now extract the binary installer from the end of this shell installer.
# source it. The sourcing extracts the rest of the files. Since this is
# done before command line processing any fatal errors are silent
# (although logged).
ExtractionPoint1=$(grep -a -n '^# Begin Extraction 1:$' "$ThisFile" | cut -d: -f 1)
if [ -n "$ExtractionPoint1" ]
then
    tail -n +$ExtractionPoint1 "$ThisFile" > "$KCS_SETUP_ENCODED"
    if [ -r "$KCS_SETUP_ENCODED" ]
    then
        # Extract the tarball containing the binaries. Note: perl and MIME::Base64 are both
        # part of lsb 3.2 and should be on any supported Linux platforms.
        if perl -MMIME::Base64 -n \
                    -e 'next if /# \{\{\{\n/;' \
                    -e 'last if /# \}\}\}\n/;' \
                    -e 'next if /# Begin Extraction 1:\n/;' \
                    -e 'print decode_base64($_)' \
                    < $KCS_SETUP_ENCODED > $KCS_SETUP 2> /dev/null
        then
            varLogWrite "I" "Agent install tree sucessfully extracted."
            [ "$Cleanup" == "true" ] && rm -f $KCS_SETUP_ENCODED
        else
            varLogWrite "F" "Failure extracting Agent install tree."
            exit $K_INSTALLER_EXTRACTION_FAILED
        fi
    else
        varLogWrite "F" "Failure extracting embedded components. Could not read extraction file."
        exit $K_INSTALLER_EXTRACTION_FAILED
    fi
else
    varLogWrite "F" "Failure extracting embedded components. Could not find 1st extraction point."
    exit $K_INSTALLER_EXTRACTION_FAILED
fi

ExtractionPoint2=$(grep -a -n '^# Begin Extraction 2:$' "$ThisFile" | cut -d: -f 1)
if [ -n "$ExtractionPoint2" ]
then
    tail -n +$ExtractionPoint2 "$ThisFile" >> "$KCS_SETUP"
else
    varLogWrite "F" "Failure extracting embedded components. Could not find 2nd extraction point."
    exit $K_INSTALLER_EXTRACTION_FAILED
fi

chmod 755 $KCS_SETUP
if ! $KCS_SETUP --version > $KCS_VERSION_FILE 2>&1
then
    attemptLibraryFixup "$KCS_SETUP"
    if ! $KCS_SETUP --version > $KCS_VERSION_FILE 2>&1
    then
        varLogWrite "F" "Installation of the Agent failed because we could not run the embedded binary installer."
        exit $K_INSTALLER_FAILED_TO_LOAD_32BIT_PACKAGES
    fi
fi

if [ -n "$Version" ]
then
    cat "$KCS_VERSION_FILE"
    rm -f $KCS_SETUP_ENCODED $KCS_SETUP $KCS_VERSION_FILE $KAGENT_INSTALL_LOG $KCS_VERSION_FILE
    trap '' EXIT
    set -
    exit 0
else
    rm -f "$KCS_VERSION_FILE"
    $KCS_SETUP "${Args[@]}"

    detectSystemd=$(ls -l `which init` | grep systemd)
    if [ -n "$detectSystemd" ]
    then
        kagentScript="/etc/init.d/kagent-$agentGuid"
        $kagentScript stop
        systemctl daemon-reload
        systemctl restart "kagent-$agentGuid.service"
    fi
fi
set -
exit 0

